import React , {Component} from 'react';
import axios from 'axios';

class Check extends Component {

	state = {
		details : [],
	}

	componentDidMount() {

		let data ;

		axios.get('http://localhost:8000/user/')
		.then(res => {
            
			data = res.data;
			this.setState({
				details : data	
			});
		})
		.catch(err => {})
        console.log(data)
        
	};

    render(){
        return(
            <div>
                  {this.state.details.map((detail, id) =>  (
                  <div>
                  <div >
                        <div >
                              <h1>{detail.detail} </h1>
                              <footer >--- by
                              <cite title="Source Title">
                              {detail.name}</cite>
                              </footer>
                        </div>
                  </div>
                  </div>
                  )
              )}
            </div>
            );
        
            }

}

export default Check;
